import React from 'react';
import Header from '../components/Header';


const Home: React.FC = () => {
    return (
        <div>
            <Header
                title="Developer Portfolio"
                links={[
                    { name: 'Home', href: '/' },
                    { name: 'Projects', href: '/projects' },
                    { name: 'Contact', href: '/contact' }
                ]}
            />
            <h1>Welcome to My Portfolio</h1>
            <p>
                I am a passionate developer with experience in building dynamic and responsive web applications.
                My skills include JavaScript, TypeScript, React, and more. 
                I love creating user-friendly interfaces and solving complex problems.
            </p>
            <h2>Skills & Experience</h2>
            <ul>
                <li>JavaScript / TypeScript</li>
                <li>React / Redux</li>
                <li>Node.js / Express</li>
                <li>HTML / CSS</li>
                <li>Responsive Design</li>
            </ul>
        </div>
    );
};

export default Home;
